$multi_order_id_map = SELECT multi_order_id, order_id
FROM (
    SELECT
        row
    FROM (
        SELECT
            ListMap(
                ListMap(
                    String::SplitToList($morder, "\n"),
                    ($l) -> {RETURN String::SplitToList($l, ","); },
                ),
                ($e) -> {
                    RETURN AsStruct(
                        $e[0] AS multi_order_id,
                        CAST($e[1] AS Int64) AS order_id
                    );
                }
            ) as data
    )
    FLATTEN LIST BY data as row
)
FLATTEN COLUMNS
;

$prev_values = 
SELECT `order_id` AS order_id, `item_id`, `id`, 
    `stats_creation_time_utc`,    `stats_creation_time_utc` + $h3 AS stats_creation_time_msk,
    `order_status_change_time_utc`, `order_status_change_time_utc` + $h3 AS order_status_change_time_msk,
    `approval_time_utc` , `approval_time_utc` + $h3 AS approval_time_msk,
    `tariff_rate`, `distribution_order_status`, 
     `is_first_order`,
     `clid`, `order_creation_time_utc`, `order_status`, `order_status_event_id`,
    `items_count`, `items_return_count`, `item_price`, `item_billed_cost`, `tariff_name`, `tariff_grid`, `partner_payment_no_vat`, `partner_payment_with_vat`, `partner_payment_no_vat_max`, `order_billed_cost`, `order_payment_no_vat`, `additional_info`, `promocode`, `promocode_data`, `paid_promo_nominal`, `paid_promo_amount`, `categories_threshold_limit`, `categories_threshold_key`, `category_id`, `feed_id`, `offer_id`, `msku`, `vid`, `distr_type`, `delivery_region_id`, `multi_order_id`
FROM (
    select `multi_order_id`, `order_id`, `item_id`, `id`, `stats_creation_time_utc`, `distribution_order_status`, `clid`, `order_creation_time_utc`, `order_status`, `order_status_event_id`, `order_status_change_time_utc`, `approval_time_utc`, `items_count`, `items_return_count`, `item_price`, `item_billed_cost`, `is_first_order`, `tariff_name`, `tariff_rate`, `tariff_grid`, `partner_payment_no_vat`, `partner_payment_with_vat`, `partner_payment_no_vat_max`, `order_billed_cost`, `order_payment_no_vat`, `additional_info`, `promocode`, `promocode_data`, `paid_promo_nominal`, `paid_promo_amount`, `categories_threshold_limit`, `categories_threshold_key`, `category_id`, `feed_id`, `offer_id`, `msku`, `vid`, `distr_type`, `delivery_region_id`,
        ROW_NUMBER() OVER (PARTITION BY h.`order_id`, h.`item_id` , h.order_status ORDER BY `h.id` DESC ) AS _row_number
    FROM  (
        select order_id, item_id, order_status
        from $data
    ) AS  i
    RIGHT SEMI join `distribution_order_stats_history` VIEW PRIMARY KEY AS h
        on i.order_id = h.order_id and i.item_id = h.item_id
    WHERE h.`stats_creation_time_utc` < $executorFinishedAt
)
WHERE _row_number = 2;

$orders_with_fraud_updates_in_recalculated_period = 
select distinct order_id
FROM `order_fraud_info` AS f 
LEFT SEMI JOIN $data AS d USING(order_id)
WHERE updated_at_utc BETWEEN $recalculated_interval_start AND $recalculated_interval_end
;

$orders_with_dwh_updates_in_recalculated_period = 
select distinct order_id
FROM `dwh_order_properties` AS p
LEFT SEMI JOIN $data AS d USING(order_id)
WHERE updated_at_utc BETWEEN $recalculated_interval_start AND $recalculated_interval_end
;

$orders_with_other_status_trantime_in_recalculated_period = 
SELECT DISTINCT  order_id
FROM `distribution_order_stats_history` VIEW PRIMARY KEY AS h
LEFT SEMI JOIN $data AS d USING(order_id)
WHERE order_status_change_time_utc BETWEEN $recalculated_interval_start AND $recalculated_interval_end
;



-- сколько строк не было вообще
select count(*) AS count_new_rows,
    COUNT_IF(
        new.multi_order_id IS NULL AND ( f.order_id IS NOT NULL OR p.order_id IS NOT NULL )
    ) AS not_multiorder_calculated_by_fraud_or_dwh_props,
    COUNT_IF(
        new.multi_order_id IS NULL
        AND NOT ( f.order_id IS NOT NULL OR p.order_id IS NOT NULL )
        AND os.order_id IS NOT NULL
    ) AS not_multiorder_calculated_by_previous_order_status,
    
    
from $data AS new
LEFT ONLY JOIN $prev_values AS old ON old.order_id = new.order_id AND old.item_id = new.item_id AND old.order_status = new.order_status
LEFT JOIN $orders_with_fraud_updates_in_recalculated_period AS f ON f.order_id = new.order_id
LEFT JOIN $orders_with_dwh_updates_in_recalculated_period AS p ON p.order_id = new.order_id
LEFT JOIN $orders_with_other_status_trantime_in_recalculated_period AS os ON os.order_id = new.order_id
;

-- смотрим подробнее
select 
new.`order_id`, `item_id`, `id`, 
    `stats_creation_time_utc` + $h3 AS stats_creation_time_msk,
    `order_status_change_time_utc` + $h3 AS order_status_change_time_msk,
    `approval_time_utc` + $h3 AS approval_time_msk,
    `tariff_rate`, `distribution_order_status`, `clid`, `order_creation_time_utc`, `order_status`, `order_status_event_id`,
    `items_count`, `items_return_count`, `item_price`, `item_billed_cost`, new.`is_first_order`, `tariff_name`, `tariff_grid`, `partner_payment_no_vat`, `partner_payment_with_vat`, `partner_payment_no_vat_max`, `order_billed_cost`, `order_payment_no_vat`, `additional_info`, `promocode`, `promocode_data`, `paid_promo_nominal`, `paid_promo_amount`, `categories_threshold_limit`, `categories_threshold_key`, `category_id`, `feed_id`, `offer_id`, `msku`, `vid`, `distr_type`, `delivery_region_id`, `multi_order_id`,
    f.updated_at_utc + $h3 AS fraud_data_update_time_msk
from $data AS new
LEFT ONLY JOIN $prev_values AS old ON old.order_id = new.order_id AND old.item_id = new.item_id AND old.order_status = new.order_status
LEFT JOIN `order_fraud_info` AS f ON f.order_id = new.order_id
LEFT JOIN `dwh_order_properties` AS p ON p.order_id = new.order_id
WHERE new.multi_order_id IS NULL
    AND NOT (
            f.updated_at_utc IS NOT NULL AND f.updated_at_utc BETWEEN $recalculated_interval_start AND $recalculated_interval_end
